Create  function [dbo].[udf_ResetFilename](@inputstring nvarchar(max) )
	Returns nvarchar(max)
As
Begin


Return replace(replace(replace(replace(replace(replace(replace(replace(replace(replace(replace(replace(replace(replace(replace(replace(replace(replace(replace(replace(replace(replace(replace(replace(
Replace(replace(replace(replace(replace(@inputstring,'-',''), '~',''), '`',''), '=',''), '+',''), ';',''),':',''), '/',''), '""',''),'"',''), '?',''),
 '&',''),'%',''),'#',''), '$',''),
