/****** Object:  UserDefinedFunction [dbo].[udf_SplitMax]    Script Date: 1/2/2021 8:02:01 AM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO

Create function [dbo].[udf_SplitMax](@stext nvarchar(max), @sdelim nvarchar(20) = ' ')
Returns @retarray table (idx smallint primary key, value nvarchar(max))
As
Begin
Declare @idx smallint,
	@value nvarchar(max),
	@bcontinue bit,
	@istrike smallint,
	@idelimlength tinyint

If @sdelim = 'space'
	Begin
	Set @sdelim = ' '
	End

Set @idx = 0
Set @stext = ltrim(rtrim(@stext))
Set @idelimlength = datalength(@sdelim)
Set @bcontinue = 1

If not ((@idelimlength = 0) or (@sdelim = 'empty'))
	Begin
	While @bcontinue = 1
		Begin

--if you can find the delimiter in the text, retrieve the first element and
--insert it with its index into the return table.
 
		If charindex(@sdelim, @stext)>0
			Begin
			Set @value = substring(@stext,1, charindex(@sdelim,@stext)-1)
				Begin
				Insert @retarray (idx, value)
				Values (@idx, @value)
				End
			
--trim the element and its delimiter from the front of the string.
			--increment the index and loop.
Set @istrike = datalength(@value) + @idelimlength
			Set @idx = @idx + 1
			Set @stext = ltrim(right(@stext,datalength(@stext) - @istrike))
		
			End
		Else
			Begin
--if you can?T find the delimiter in the text, @stext is the last value in
--@retarray.
 Set @value = @stext
				Begin
				Insert @retarray (idx, value)
				Values (@idx, @value)
				End
			--exit the while loop.
Set @bcontinue = 0
			End
		End
	End
Else
	Begin
	While @bcontinue=1
		Begin
		--if the delimiter is an empty string, check for remaining text
		--instead of a delimiter. Insert the first character into the
		--retarray table. Trim the character from the front of the string.
--increment the index and loop.
		If datalength(@stext)>1
			Begin
			Set @value = substring(@stext,1,1)
				Begin
				Insert @retarray (idx, value)
				Values (@idx, @value)
				End
			Set @idx = @idx+1
			Set @stext = substring(@stext,2,datalength(@stext)-1)
			
			End
		Else
			Begin
			--one character remains.
			--insert the character, and exit the while loop.
			Insert @retarray (idx, value)
			Values (@idx, @stext)
			Set @bcontinue = 0	
			End
	End

End

Return
End














