The bradford index formula is:

S x s x d = (index)

Where 

S is the number of occasions (spells) of absence and 

D is the total number of days absent.

For example:

Five absences of one or two days (2 +1+2 +2 +1) gives s = 5', N' and d = 8

Thus (5 x 5 x 8) = 200

A single long absence of six weeks (30 days) scores

1 x 1 x 30 = 30

But if that person had another absence of three days', N' the new calculation would show:


2 x 2 x 33 = 132

Note: the index can be used at the level of hours worked/absent if that is more appropriate - see www.Acas.Co.Uk/absence.

Source : http://www.Wao.Gov.Uk/printVersionEng/1513.Asp.Asp"', N'operational excellence', N'', N'score', N'', N'', N'', N'', N'', N'', N'', N'', N'', N'', N'', N'', N',,,,0')
