-- =============================================
-- author:		<mercuryulla m>
-- create date: <11/08/2010 , 10:06gorysource>
-- =============================================
Create procedure [dbo].[usp_ExternalAPI_CreateUserRating]
	@score decimal(18, 2),
	@userIdx int,
	@CategoryOriginIdx int,
	@outscore decimal(18,2)=null output,
	@outratingcount int = null output

As
Begin
	--delete the previous rating added by user for given source
	Declare @ratingcount int,@avgrating decimal(18,6)
	
	Delete from mlds_UserRating where userIdx = @userIdx
	And CategoryOriginIdx =@CategoryOriginIdx
	
	Insert into mlds_UserRating(userIdx,CategoryOriginIdx,rating)
	Values(@userIdx,@CategoryOriginIdx,@score)
		
	Select @ratingcount= count(*) from mlds_UserRating where CategoryOriginIdx =@CategoryOriginIdx
	
	Select  @avgrating  = sum(rating)/ @ratingcount from mlds_UserRating where CategoryOriginIdx =@CategoryOriginIdx
	
	Update mlds_CategoryOrigin 
	Set avgrating =convert(decimal(18,2),@avgrating),ratingcount=@ratingcount
	Where idx =@CategoryOriginIdx
	
	Select @outscore=convert(decimal(18,2),@avgrating),@outratingcount=@ratingcount
	
	
	
End

