-- =============================================
-- author:		<mercuryulla m>
-- create date: <10/26/2010, 16:48>
-- description:	<get all category source>
-- =============================================
Create procedure [dbo].[usp_ExternalAPI_GetAllCategoryOrigin]
	@userIdx int =null
As
Begin
	Set nocount on;
	If( @userIdx is null)
	Begin
		Select * ,0 as isuserfavourite from mlds_CategoryOrigin order by categoryIdx,avgrating desc
	End 
	Else
	Begin
		Select  dh.* ,case isnull(dhu.UserIdx,0)  when  0 then 0 else 1 end isuserfavourite from mlds_CategoryOrigin dh left outer join 
		( select * from mlds_UserCategoryOrigin where userIdx =@userIdx ) dhu on  dh.idx = dhu.CategoryOriginIdx order by categoryIdx asc,avgrating desc
	End
	End
	
	
	


