Create procedure [dbo].[usp_ExternalAPI_GetAllFeedbacks]
	@userIdx int =null
As
	Begin
	If( @userIdx is null)
	Begin
		Select fb.*,fbc.Name as categoryname from mlds_Feedback fb inner join mlds_FeedbackCategory  fbc
			On fb.FeedbackcategoryIdx = fbc.idx order by fb.Createdon desc
		End
	Else
	Begin
		Select fb.*,fbc.Name as categoryname from mlds_Feedback fb inner join mlds_FeedbackCategory  fbc
		On fb.FeedbackcategoryIdx = fbc.idx where fb.UserIdx =@userIdx order by fb.Createdon desc
	End
	
	End
	
	
	




