-- =============================================
-- author:		<mercuryulla m>
-- create date: <12/01/2010 18:43:32 >
-- description:	<get all Labels>
-- =============================================
Create procedure [dbo].[usp_ExternalAPI_GetAllLabels]
	
As
	Begin
		
Select dht.idx , dht.Name , dht.Createdby , dht.Createdon , dht.Lastupdatedby,dht.Lastupdatedon , 
		Case when count(dhct.LabelIdx) > 0 then 1 else 0 end isassociated
		From mlds_Lables dht left outer join
		(
				Select 	distinct dhct.LabelIdx from 	dbo.DhCategoryOriginLabels dhct
				Inner join dbo.DhCategoryOrigin dcs
				On dhct.CategoryOriginIdx=dcs.idx and dcs.Active =1

		) dhct
		On dht.idx = dhct.LabelIdx 
		Group by dht.idx , dht.Name , dht.Createdby , dht.Createdon , dht.Lastupdatedby,dht.Lastupdatedon
		Order by dht.Name asc
	End
	
	
	


