/****** Object:  StoredProcedure [dbo].[usp_Getspreadsbyperiod]    Script Date: 1/2/2021 8:02:02 AM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
--exec usp_Getspreadsbyperiod 12, 2001, 3, 3, 1
Create proc [dbo].[usp_Getspreadsbyperiod]
	@budgetnoofperiods int, @intyear int, @intbgtnoofyears int, 
	@fystartcalandermonth int = 1, @cyfymonthstart int = 1
As
Begin
	--waitfor delay '00:0:10';
	Declare @perStartYear int, @perStartMonth int, @perEndYear int, @perEndMonth int
	Select	
		@perStartYear = @intyear, 
		@perStartMonth = @fystartcalandermonth, 
		@perEndYear = @intyear + @intbgtnoofyears - 1,
		@perEndMonth = @fystartcalandermonth - 1
		
	If @fystartcalandermonth > 1
	Begin
		Select @perStartYear = @intyear - 1
	End

	If @fystartcalandermonth = 12
	Begin
		Select @perEndMonth = 1
	End
	Else if @fystartcalandermonth = 1 
	Begin
		Select @perEndMonth = @budgetnoofperiods
	End


	Select
		SpreadId, spreadCode, fiscalYear, fiscalMonth, amount
	Into #tempMlds_SpreadData
	From
	(
		Select 
			Dsm.idx spreadId, dsm.Code spreadCode, 
			Ysrc.[tempYear] fiscalYear, dsf.Month fiscalMonth, 
			Isnull(dsf.Amount, 0) amount
		From
			DhSpreadsMaster dsm, mlds_SpreadSheetDataPeriods dsnpm, mlds_SpreadSheetFact dsf, 
			(select (idx + @intyear - 1) [tempYear] from mlds_SpreadSheetBase where idx between 1 and @intbgtnoofyears) ysrc
		Where
			Dsm.idx = dsnpm.SpreadId and
			Dsm.idx = dsf.SpreadId and
			Dsnpm.SpreadId = dsf.SpreadId and
			Dsnpm.NoPeriods = dsf.NoPeriods and
			Dsf.Month between dsnpm.PeriodStart and dsnpm.PeriodEnd and
			Dsnpm.NoPeriods = @budgetnoofperiods and
			Dsnpm.SpreadBasisId  = 1
		Union
		Select 
			Dsm.idx spreadId, dsm.Code spreadCode, 
			Case when @perStartMonth > 1 and dsf.Month >= @perStartMonth  then dsf.Year+1 else dsf.Year end fiscalYear, 
			Case when @perStartMonth > 1 then case when dsf.Month >= @perStartMonth then dsf.Month - @perStartMonth + 1  else @budgetnoofperiods + dsf.Month - @perStartMonth + 1 end else dsf.Month end fiscalMonth, 
			Isnull(dsf.Amount, 0) amount
		From
			DhSpreadsMaster dsm, mlds_SpreadSheetDataPeriods dsnpm, mlds_SpreadSheetFact dsf
		Where
			Dsm.idx = dsnpm.SpreadId and
			Dsm.idx = dsf.SpreadId and
			Dsnpm.SpreadId = dsf.SpreadId and
			Dsnpm.NoPeriods = @budgetnoofperiods and
			Dsnpm.NoPeriods = dsf.NoPeriods and
			Dsf.Year between @perStartYear and @perEndYear and
			(
				(dsf.Year = @perStartYear and dsf.Month >= @perStartMonth) or
				(dsf.Year = @perEndYear and dsf.Month <= @perEndMonth) or
				(dsf.Year between @perStartYear+1 and @perEndYear-1)
			) and 
			Dsnpm.SpreadBasisId  = 2 and
			Dsf.Month <= dsf.NoPeriods and dsnpm.CyFyMonthStart = @cyfymonthstart
	) src
	
	Declare @strPrd nvarchar(max),@sqlqry nvarchar(max)
	
	Select @strPrd = coalesce(@strPrd + ',', '') + '[' + convert(nvarchar,fiscalYear) + '-' + convert(nvarchar,fiscalMonth) + ']' 
	From #tempMlds_SpreadData
	Group by fiscalYear, fiscalMonth
	 
	--print @strPrd
	Select  @sqlqry = '	select	
							SpreadId, spreadCode, ' + @strPrd + '
						From
							(select spreadId, spreadCode, convert(nvarchar, fiscalYear)+''-''+ convert(nvarchar, fiscalMonth) as fiscalMonth, amount 
								From  #tempMlds_SpreadData 
							) as src
							Pivot ( sum( amount) for fiscalMonth in ( '+ @strPrd +')) as pvt
						Order by spreadCode'
	Exec ( @sqlqry)
	
	 
			
End
GO
