Create procedure [dbo].[usp_GetKPIStratagies]
 @categoryKey nvarchar(100)='%'
 ,@Stratagy nvarchar(100)
,@dshRssFeedUrl nvarchar(max)-- comes from web.Config of dsh service
,@tmpCustBaseFeedRootUrl nvarchar(max)='' ---temporery base feed root url used for accessing feed data of each individual KPI

As 
Begin 
	Select  '<?Xml version="1.0" encoding="Us-ascii"?>


	<rss version="2.0">
		<channel>
			<title>dh</title>
			<link>'+ @dshRssFeedUrl +'</link>
			<description>feed for ' + @Stratagy + ' KPIs</description>
			<language>en-us</language>
			<lastbuilddate>' + convert(nvarchar(50), getutcdate()) +'</lastbuilddate>'
	        
	 As dshheader

	 

	Select  

	'<item>' +
	'<title>' + 	replace(replace(replace(replace(replace( replace(  replace(replace( replace( replace(dbo.CommonResetfilenamestring(name) ,'/>','/>'),'>','>'),'<','<'),'"','   '),'""','&quot;'),'&','&amp;'),'<','&lt;'),'>','&gt;'),'"','&quot;'),'''','&apos;') + '</title>
	<link>'+ @tmpCustBaseFeedRootUrl+ dbo.CommonResetfilenamestring(name) +'.Xml</link>' +
	'<description>'+replace( replace(replace( replace(replace(shortdesc,'&','&amp;'),'<','&lt;'),'>','&gt;'),'"','&quot;'),'''','&apos;') + ' </description>' 
	+'<language>en-us</language>
	<guid  ispermalink ="True">' +replace(  replace(replace( replace( replace(dbo.CommonResetfilenamestring(name) ,'/>','/>'),'>','>'),'<','<'),'"','  '),'""','&quot;') +'</guid>
	<pubdate>' +convert(nvarchar(100),lastupdatedon)  +'</pubdate>' + '</item>'  dshfeeddata 

	From  dh.Dbo.DhCategoryOrigin dshdata where name like @categoryKey
	
	Select
	  '</channel>
	</rss>' as dshfooter

	----------------------------------------------------

End
