Create procedure [dbo].[usp_GetCustomerItemsByKPIStratagy]
 @categoryKey nvarchar(100)='%'
,@Stratagy nvarchar(100)

,@tmpCustBaseFeedRootUrl nvarchar(max)='' ---temporery base feed root url used for accessing feed data of each individual KPI

As 
Begin 
	
	If len(@tmpCustBaseFeedRootUrl) >0
	Begin
		If  right(@tmpCustBaseFeedRootUrl,1)='/'
			Select 	@tmpCustBaseFeedRootUrl=substring(@tmpCustBaseFeedRootUrl,1,len(@tmpCustBaseFeedRootUrl)-1) 
			
	End
	
	Declare @tmpDshCustomerData table
	(
		 Id int identity
		 ,dshCatSourceIdx int
		,[fileName] nvarchar(max)
		,fileUrl  nvarchar(max)
		,xmlheader nvarchar(max)
		,data nvarchar(max)
		,xmlfooter nvarchar(max)
	 )

	Declare @beginIdx int
	Declare @endIdx int
	Declare @cntr int
	Select @beginIdx=isnull(min(idx),0) from dh.Dbo.DhCategoryOrigin where name like @categoryKey
	Select @endIdx=isnull(max(idx),0) from dh.Dbo.DhCategoryOrigin  where name like @categoryKey
	Select @cntr=@beginIdx
	Declare @customerWebRssFeedUrl nvarchar(max)
	Declare @website nvarchar(max)
	Declare @fileName nvarchar(max)
	Declare @name nvarchar(100)
	Declare @shortdesc nvarchar(max)
	Declare @lastupdateddate nvarchar(50)
	Declare @header nvarchar(max) 
	Declare @footer nvarchar(max) 

	Select @footer=
	  '</channel>
	</rss>'

	While @cntr<=@endIdx
	Begin
		

		Select 
		 @website=websiteurl 
		,@customerWebRssFeedUrl= @tmpCustBaseFeedRootUrl +'/' +dbo.CommonResetfilenamestring(name) +'.Xml'
		,@fileName=dbo.CommonResetfilenamestring(name) +'.Xml'
		,@name=dbo.CommonResetfilenamestring(name)
		,@shortdesc=shortdesc
		,@lastupdateddate=convert(nvarchar(100),lastupdatedon) 
		 From dh.Dbo.DhCategoryOrigin where idx=@cntr and   name like @categoryKey

		

	Set @header=
	(
		Select  '<?Xml version="1.0" encoding="Us-ascii"?>


		<rss version="2.0" xmlns:' +@name +'="' + @name +'">
		<channel>
			<title>feed for ' + @name +'</title>
			<link>' +@website +'</link>
			<description>' + @shortdesc +'</description>
			<language>en-us</language>
			<lastbuilddate>' + convert(nvarchar(50), @lastupdateddate) +'</lastbuilddate>'
	        
	)

		
		Insert into @tmpDshCustomerData 
		Select  top 38 @cntr ,@fileName,@customerWebRssFeedUrl,@header, data='<item>' +
		'<title>' + 	 replace(  replace(replace( replace( replace(title,'/>','/>'),'>','>'),'<','<'),'"','   '),'""','&quot;') + '</title>
		<link>' +@customerWebRssFeedUrl +'</link>' +
		'<description>'+replace( replace(replace( replace(replace(description,'&','&amp;'),'<','&lt;'),'>','&gt;'),'"','&quot;'),'''','&apos;') + ' </description>' 
		+'<language>en-us</language>
		<guid  ispermalink ="True">' +replace(  replace(replace( replace( replace(permalink,'/>','/>'),'>','>'),'<','<'),'"','  '),'""','&quot;') +'</guid>
		<pubdate>' +convert(nvarchar(100),getutcdate())  +'</pubdate>
		<' +@name +':content KPICode="' + 
		Replace(  replace(replace( replace( replace(id,'/>','/>'),'>','>'),'<','<'),'"','  '),'""','&quot;')
		+   '" '+ @Stratagy + '= "' +replace(  replace(replace( replace( replace(strategy,'/>','/>'),'>','>'),'<','<'),'"','  '),'""','&quot;')
		+  '" frequency= "' + 
		Replace(  replace(replace( replace( 
		Replace([measurement frequency],'/>','/>'),'>','>'),'<','<'),'"','  '),'""','&quot;') 
		+ '" frequencyType="' 
		+ replace(  replace(replace( replace( 
		Replace(direction,'/>','/>'),'>','>'),'<','<'),'"','  '),'""','&quot;') +'" description=""  numberFormat= "' + replace(  replace(replace( replace( replace([unit type],'/>','/>'),'>','>'),'<','<'),'"','  '),'""','&quot;')+ '" formula= "' 
		+ replace(  replace(replace( replace( replace(formula,'/>','/>'),'>','>'),'<','<'),'"','  '),'""','&quot;')   + '"
		  Title="' + 	 replace(  replace(replace( replace( replace(title,'/>','/>'),'>','>'),'<','<'),'"','   '),'""','&quot;') + '">
		<![cdata[' +replace( replace(replace( replace(replace(description,'&','&amp;'),'<','&lt;'),'>','&gt;'),'"','&quot;'),'''','&apos;') + ']]>
		 </'+@name +':content>
		</item>' ,@footer
		 From [dbo].[mlds_KPIFeedsHRRatios] feed   
		  
		  Select @cntr=@cntr+1
	End

Select  * from @tmpDshCustomerData order by dshCatSourceIdx
End
